import React from 'react';
import CustomSelect from './CustomSelect';
import {variables} from "../../Variables";

const styles={
  app:{
    // backgroundColor:'rgba(0,0,0,0.1)',
    // justifyItems:'center',
    // alignItems:'center',
    // display:'grid',
    height:'1vh',
    // fontFamily:'Arial',
    color:'rgba(0,0,100,1)',
    // gridTemplateColumns:'1fr',
    fontSize:15
  },
  select:{
    width:'100%',
    maxWidth:600
  }
}

const data = fetch(variables.MUSCLE_API_URL)
            .then(response => response.json())
            .then(result => result.map(function (line){
              console.log(line)
            }))

// const options=[
//   {label:'React',value:'react'},
//   {label:'ReactNative',value:'react-native'},
//   {label:'JavaScript',value:'js'},
//   {label:'CSS',value:'css'},
// ]

const options=[]

function onChangeInput(value){
  console.log(value);
}
function App() {
  return (
    <div style={styles.app}>
      {console.log(data)}
      <CustomSelect isMulti={true} style={styles.select} defaultValue={[options[3],options[2]]} onChange={onChangeInput} options={options} label="Choose a libary" />
    </div>
  );


}

export default App;
